import Slider from 'react-slick'

export default function HeroSection(){

    const settings = {
        dots: false,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
      };

    return(
        <div>
          <Slider {...settings}>
          <div>
            <img src="https://getir.com/_next/static/images/getir-mainpage-1-757eca6a46304def60cabce74d3f20a2.jpg" alt="" />
          </div>
          </Slider>
        </div>
    )
}
